import React from "react";
import { Container, Row } from "react-bootstrap";
import AtheleteMenu from "./AtheleteMenu";
import ProfileContent from "./Components/ProfileContent";
import ProfileDetails from "./Components/ProfileDetails";
import ProfileNavigation from "./Components/ProfileNavigation";

const AtheProfileLayout = ({ children }) => {
  return (
    <AtheleteMenu>
      <section
        style={{ width: "90%", marginRight: "40px" }}
        className="m-auto mt-4"
      >
        <Container>
          <Row>
            {/* <div className="profile-back"></div> */}
            <img src="/images/profile_heading.png" />
          </Row>

          <ProfileDetails />
          <br />
          <Row className="justify-content-between" style={{ gap: "20px" }}>
            <ProfileNavigation />
            {/* <Col
              sm={1}
              style={{ border: "1 px solid lightgray", height: "100%" }}
            ></Col> */}
            <ProfileContent>{children}</ProfileContent>
          </Row>
        </Container>
      </section>
    </AtheleteMenu>
  );
};

export default AtheProfileLayout;
